import React from 'react';
// import { Button } from 'react-bootstrap';
import './FloatingButton.css';

const FloatingButton = ({ onClick }) => {
  return (
    <Button
      className="floating-button"
      variant="primary"
      onClick={onClick}
    >
      Cargar producto
    </Button>
  );
};

export default FloatingButton;
